#-----------------------------------------------------------------------------------------------------------------------------------#
#TOTAL Portfolio Value #
use finance;
SELECT 
    SUM(quantity * current_price) AS total_portfolio_value,
    SUM(quantity * buy_price) AS total_investment,
    SUM(share_price * outstanding_shares) AS total_market_cap
FROM stocks;

#-----------------------------------------------------------------------------------------------------------------------------------#

# Portfolio Value by Sector #
SELECT 
    sector,
    SUM(current_value) AS sector_portfolio_value
FROM stocks
GROUP BY sector;

#-----------------------------------------------------------------------------------------------------------------------------------#

# Top % Stocks by Portfolio Value #
SELECT 
    company_name,
    current_value
FROM stocks
ORDER BY current_value DESC
LIMIT 5;

#-----------------------------------------------------------------------------------------------------------------------------------#

# Total Trades By Portfolio #
SELECT 
    p.portfolio_name,
    COUNT(tr.trade_id) AS total_trades
FROM facts_trades tr
JOIN dim_portfolio p
    ON tr.portfolio_id = p.portfolio_id
GROUP BY p.portfolio_name
order by p.portfolio_name;
#-----------------------------------------------------------------------------------------------------------------------------------#

# Worst Performing Stocks #

SELECT 
    company_name,
    return_pct
FROM stocks
ORDER BY return_pct ASC
LIMIT 3;

#-----------------------------------------------------------------------------------------------------------------------------------#

# Monthly Trades Trend BY Trader #
SELECT 
    c.year,
    c.month,
    t.trader_name,
    COUNT(tr.trade_id) AS total_trades
FROM facts_trades tr
JOIN dim_trader t
    ON tr.trader_id = t.trader_id
JOIN dim_calendar c
    ON tr.calendar_id = c.calendar_id
GROUP BY 
    c.year, 
    c.month, 
    t.trader_name
ORDER BY 
    c.year, c.month, total_trades DESC;

#-----------------------------------------------------------------------------------------------------------------------------------#

# Monthly Trades Trend #
SELECT 
    cal.year,
    cal.month,
    COUNT(tr.trade_id) AS total_trades
FROM facts_trades tr
JOIN dim_calendar cal
    ON tr.calendar_id = cal.calendar_id
GROUP BY cal.year, cal.month
ORDER BY cal.year, cal.month;

